import React from 'react';
import Login from './Login';
import Global from "../componentes/global";

const VerAgricultor = ({nombres, apellidos }) => {
  console.log(Global.nombres);
  return (
    <div>

      <p>Nombres :{Global.nombres}</p> 
      <p>Apellidos :{Global.apellidos}</p>
    </div>
  )
}

export default VerAgricultor
